import React ,{ Component } from 'react';

class MyForm extends Component{
    constructor(props){
        super(props);
        this.state={
            name:'abc',
            message:'',
            fruit:'Aplle'
        }
        this.handleChange = this.handleChange.bind(this);
    }
    handleChange(event){
        this.setState({
            name:event.target.value
        })
    }
    render(){
        const{state}=this;
        return(
            <form>
                <div>

                </div>
               
                <label>
                    Fruta:
                    <select value={state.fruit}>
                        <option value="Apple">
                            Apple
                        </option>
                        <option value="oragen">
                            oragen
                        </option>
                    </select>
            </label>
                <label>
                    Message:
                        <textarea value="{state.message}"/>
            </label>
                    <input type="submit" value="enviar"/>
                </form>
        )
    }
}
export default MyForm;
